import React from "react"
import { Link } from "next/link"

class Layout extends React.Component {
    constructor(props) {
        super(props);
        this.state = { };
    }

    render() {
        return (
            <main>
                <nav>
                    <Link href="/">
                        <a style={{ fontSize: 20 }}>Home</a>
                    </Link>
                </nav>
                {this.props.children}
            </main>
        );
    }
}

export default Layout;
